This processor expects that the "system" field in the $translate result will have a Value that can be looked up in the StructurDefinition <> ValueSet KeyValue store, that can be mapped to the desired StructureDefinition URL:

For instance, given the translation result below, there should be an entry from:

http://ibm.com/fhir/cdm/ValueSet/sex-assigned-at-birth-vs -> http://ibm.com/fhir/cdm/StructureDefinition/sex-assigned-at-birth

{
	"resourceType": "Parameters",
	"parameter": [
		{
			"name": "result",
			"valueBoolean": true
		},
		{
			"name": "match",
			"part": [
				{
					"name": "equivalence",
					"valueCode": "equivalent"
				},
				{
					"name": "concept",
					"valueCoding": {
						"system": "http://ibm.com/fhir/cdm/ValueSet/sex-assigned-at-birth-vs",
						"code": "female",
						"display": "Female"
					}
				}
			]
		}
	]
}

